class Solution {
public:
    int threeSumMulti(vector<int>& A, int target) {
        int n = A.size();
        long long ans = 0;
        for (int i = 0; i < n - 2; i++) {
            int j = i + 1, k = n - 1;
            while (j < k) {
                if (A[i] + A[j] + A[k] == target) {
                    if (A[j] == A[k]) {
                        ans += (k - j + 1) * (k - j) / 2;
                        break;
                    }
                    int left = 1, right = 1;
                    while (j < k && A[j] == A[j + 1]) {
                        j++;
                        left++;
                    }
                    while (j < k && A[k] == A[k - 1]) {
                        k--;
                        right++;
                    }
                    ans += left * right;
                    j++;
                    k--;
                } else if (A[i] + A[j] + A[k] < target) {
                    j++;
                } else {
                    k--;
                }
            }
        }
        return ans % int(1e9 + 7);
    }
};

