public:
    string splitLoopedString(vector<string>& strs) {
        string s;
        for (auto& str : strs) {
            string rev = str;
            reverse(rev.begin(), rev.end());
            s += max(str, rev);
        }
        int n = s.size();
        vector<char> maxs(n);
        for (int i = 0; i < n; ++i) {
            int j = i;
            while (j < n && s[j] <= s[i]) ++j;
            maxs[i] = s[j - 1];
        }
        string res;
        for (int i = 0; i < n; ++i) {
            for (int j = 0; j < strs.size(); ++j) {
                string str = strs[j];
                string rev = str;
                reverse(rev.begin(), rev.end());
                if (str[0] == s[i]) {
                    string t = s.substr(i) + s.substr(0, i);
                    if (t.find(str) != string::npos && t.find(str) > t.find(res)) {
                        res = t.substr(t.find(str), str.size());
                    }
                }
                if (rev[0] == s[i]) {
                    string t = s.substr(i) + s.substr(0, i);
                    if (t.find(rev) != string::npos && t.find(rev) > t.find(res)) {
                        res = t.substr(t.find(rev), rev.size());
                    }
                }
            }
            if (s[i] != maxs[i]) break;
        }
        return res;
    }
};

