class Solution {
public:
    int maxLevelSum(TreeNode* root) {
        int maxSum = root->val;
        int maxLevel = 1;
        queue<TreeNode*> q;
        q.push(root);
        int level = 1;
        while(!q.empty()) {
            int curSum = 0;
            int curSize = q.size();
            for(int i = 0; i < curSize; ++i) {
                TreeNode* cur = q.front();
                q.pop();
                curSum += cur->val;
                if(cur->left) {
                    q.push(cur->left);
                }
                if(cur->right) {
                    q.push(cur->right);
                }
            }
            if(curSum > maxSum) {
                maxSum = curSum;
                maxLevel = level;
            }
            ++level;
        }
        return maxLevel;
    }
};

